  "geo" : {
  },
  "id_str" : "117284869154938882",
  "text" : "あと普通の人と違いそうなのは、プロパティの存在。T getX(), T setX(T value)じゃなくて、getのみならT X()、get&setならT& X()にしてるって点ですかね。 [n]",
