  "text" : "そんなわけで、自分のC++コードは、メンバーでない関数なし、include保護除く#defineなし、publicフィールドとかありえない（定数除く）、名前空間が多段、ヘッダでusingとかtypedefするやつ滅びよ、な状態になっています。 [n]",
