  "text" : "「とても残念なことだけれど、ある種のものごとは、後ろ向きには進まないのよ。それは一度前に行ってしまうと、どれだけ努力をしても、もうもとには戻れないのよ。もしもそのときに何かがほんの少しでも狂っていたら、それは狂ったままそこに固まってしまうのよ。」（村上春樹『国境の南、太陽の西』）",
