  "id_str" : "112803704696094720",
  "text" : "1年ぐらい前、遅くなったのでいつものように地下実験室横の準備室にあるソファーベッドに寝に行ったんですよ。20時ぐらいに。夜の学校怖いって言われるんですが、慣れるとそうでもなく。で、普段通り寝て、しばらくしたら、なんだかぱっと目が覚めたんです。（続く） [n]",
  "id" : 112803704696094720,
