  "text" : "轟々と音を立て（てそうに）流れている川を見てみたい＆撮ってみたいと思う一方で、危険さも十分承知しているので、葛藤。どうせ河川敷まで水位が到達してるっぽいので、橋とか堤防の上からなら・・・。水位も下がり始めてるようなので（いやまだ上がる可能性あるけど）。 [n]",
